import './Homepage.css'
import { useNavigate } from 'react-router-dom'

const Homepage = () => {
    const [disabled,setDisabled] = useState(true)
    let navigate = useNavigate()

    const handleClick = ()=>{
        navigate("/game")
    }
  return (
      <div className='home-container'> 
    <h1>Select Room</h1>

    <div className='room-container'>
        <input type="text" placeholder='Input name'/>

        <input type="text" placeholder='Input room'/>

      <button {...disabled ?'disabled':''} onClick={handleClick} className='submit-btn' type='submit' name='Enter a game'>Enter the game</button>
    </div>

      </div>
     )
}

export default Homepage
